Description:
Maşın'ın qiyməti (8500AZN)
- dəmirçi işi; 
- rəngsaz işi; 
- elektrik işi; 
- sürətlər qutusu (müəyyən vaxtlarda qəza rejiminə keçir) və s. xərcləri nəzərə alınmaqla təyin edilib.
Nömrəsiz satılır!

WVWZZZ1KZ8W566678

Changan Qiyuan Q05 125 Max komplektasiyası. Sinifinin ən full versiyası olan MAX komplektasiyasıdır. Avtomobil yenidir, gömrük olunub, nömrə alınıb və sığorta olunub.Avtomobilin 2 matoru var. Benzin motorunun gücü 1.5L / 110 Hp, elektrik matorunun gücü isə 158kW-dır. Sadə benzin mator olduğuna görə 92 oktanlı benzinlə çalışır. Batareyanın tutumu 18.4 kWh-dır və 125 km-ə qədər yalnız elektriklə məsəfə qət edə bilir. Həm yavaş, həm də sürətli şarj doldurma portu var. WLTC standartlarına görə kombinə olunmuş yanacaq sərfiyyatı cəmi 1.33 litrdir.Avtomobil digər PRO komplektasiyalarında olmayan bir çox üstün xüsusiyyətlərə malikdir. Avtomobilin bəzi xüsusiyyətləri aşağıdakılardır:
- Ön radarlar;
- Arxa radarlar;
- Ön toqquşma xəbərdarlığı;
- Arxa toqquşma xəbərdarlığı (Rear Collision Warning);
- Avtomatik parking;
- Üz tanıma fünksiyası (Face İD);
- Qapının açıq qalması xəbərdarlığı (DOW Open Door Alert);
- Çoxqatlı səs izolyasiya sistemi (Multi-layer soundproofing);
- Yaddaşlı oturacaqlar;
- Sürücü və sərnişin oturacağının isitmə funksiyası;
- Kor zona xəbərdarlığı;
- Yan güzgülərin elektrik qızdırıcısı
- Smartfonun simsiz şarj funksiyası (Wireless charging function for cell phones).
- Məsafədən mühərrikin işə salınması;
- Pult vasitəsilə avtomobilin önə və arxaya hərəkət etdirilməsi;
- Adaptiv cruise control;
- Zolaq saxlama funksiyası;
- 7 kamera;
- 12 ultrasonic radar;
- 3 millimetrlik radar;
Və s.
